INSERT INTO `project` VALUES (45, 'Azino 777', 46, 123, '50', 'Интернет-казино — это сайт или специальная программа, которые предоставляют доступ к любым видам азартных игр при наличии подключения к интернету. Виртуальное казино и онлайн-казино — синонимы Интернет-казино.\n\nИнтернет казино — обширное понятие. Подобные проекты могут предлагать совершенно разные виды азартных развлечений. Чаще всего их ассортимент составляют всевозможные игровые автоматы, рулетку, покер и другие карточные игры.\n\nГлавной особенностью интернет казино является доступность подобных ресурсов. Получить доступ к играм можно при помощи любого устройства с подключением к интернету, будь то настольный компьютер, ноутбук, телефон, планшет или даже телевизор', NULL, NULL, 4, 7, 12, 23, 24, 35, 38, 43, 88, 1, 1495, 89, '2018-05-05 10:37:36');
INSERT INTO `project` VALUES (46, 'Ofo', 45, 10000, '12', 'Choose a better bike share', NULL, NULL, 2, 6, 13, 23, 25, 32, 38, 42, 88, 1, 1116, 86, '2018-05-05 10:43:35');
INSERT INTO `project` VALUES (47, 'Google', 44, 4294967295, '12', 'Google управляет более чем миллионом серверов в центрах обработки данных по всему миру и обрабатывает более одного миллиарда поисковых запросов и 24 петабайт пользовательских данных каждый день. Быстрый рост Google с момента её основания привёл к появлению большого числа продуктов, не связанных непосредственно с главным продуктом компании — поисковой системой. У Google есть такие онлайн-продукты как почтовый сервис Gmail, социальная сеть Google+. У компании есть и десктопные продукты, такие как браузер Google Chrome, программа для работы с фотографиями Picasa и программа мгновенного обмена сообщениями Hangouts. Кроме того, Google ведёт разработку мобильной операционной системы Android, используемой на большом количестве смартфонов, а также операционной системы Google Chrome OS и устройства Google Glass. По данным Alexa, основной сайт Google — google.com — является самым посещаемым сайтом Интернета, а многочисленные международные сайты Google (google.co.in, google.co.uk и т. д.) входят в первую сотню по посещаемости, как и несколько других сайтов сервисов Google — YouTube, Blogger и Orkut. В мае 2011 года количество уникальных посетителей сайтов Google за месяц впервые превысило 1 млрд человек. ', '../img/project_avatar/1525495998.6333google.png', '../uploads/1525495998.8246google.png', 3, 10, 12, 23, 30, 31, 41, 42, 88, 0, 7, 0, '2018-05-05 10:53:18');
INSERT INTO `project` VALUES (48, 'Facebook', 45, 4294967295, '12', 'Facebook позволяет создать профиль с фотографией и информацией о себе, приглашать друзей, обмениваться с ними сообщениями, изменять свой статус, оставлять сообщения на своей и чужой «стенах», загружать фотографии и видеозаписи, создавать группы (сообщества по интересам).\n\nВ 2007 году Facebook предложил сторонним программистам создавать приложения (игры, средства обмена музыкой, фотографиями и т. д.) и зарабатывать на этом. Благодаря этой возможности посещаемость сайта повысилась.\n\nFacebook предлагает множество функций, с помощью которых пользователи могут взаимодействовать между собой. Среди наиболее популярных — виртуальное подмигивание, фотоальбомы и «стена», на которой знакомые пользователя могут оставлять текстовые и аудиовизуальные сообщения.\n\nПользователь может контролировать уровень доступа к информации, опубликованной в его профиле, и определять, кто имеет доступ к той или иной части страницы.\n\nТакже на сайте есть возможность пожаловаться на неприятных пользователей или заблокировать их.\n\nВ апреле 2016 года Марк Цукерберг заявил, что Facebook запускает Facebook Live — новую функцию прямой видеотрансляции. Благодаря ей пользователи смогут создавать видеоролики, сообщения и передавать их друг другу в реальном времени.\n\nС ноября 2017 года в веб-версии сайта стал доступен просмотр историй\nКнопка «Нравится» на Facebook\n\n«Нравится» — это выражение согласия или одобрения к понравившейся записи. Например, если пользователю Facebook понравилась какая-нибудь песня.\n\n23 января 2013 года Facebook для русскоязычных пользователей переименовал кнопку «Like» с «Мне нравится» на «Нравится».\n\nВ 2015 году Facebook запустил бета-тестирование новой функции «Reaction» для пользователей Ирландии и Испании. Основная задача новой функции — дать пользователям больше способов для выражения своего отношения к контенту, чем это было возможно с помощью традиционной кнопки Like, через использование анимированных смайлов с различными эмоциональными оттенками.\n\nВ 2015 году Facebook приступила к тестированию новой рекламной функции для своего мобильного приложения. Функция получила название «Shopping». Основная задача нововведения — показ пользователям рекламы различных товаров в их новостной ленте. Виды товаров будут варьироваться в зависимости от их интересов, контактов и их активности.\n\n24 февраля 2016 года в Facebook появилось пять новых разновидностей реакций при использовании кнопки «Like». Теперь благодаря этой опции владельцы аккаунтов могут выразить удивление, смех, грусть, гнев и любовь. Чтобы выбрать один из вариантов, необходимо нажать и удержать «Like». ', '../img/project_avatar/1525496194.2535fb.png', '../uploads/1525496194.2637fb.png', 3, 11, 13, 19, 27, 32, 38, 43, 88, 3, 499, 106, '2018-05-05 10:56:33');
INSERT INTO `project` VALUES (49, 'PiedPiper', 45, 1000000, '12', 'Га́мельнский крысоло́в (нем. Rattenfänger von Hameln), гамельнский дудочник — персонаж средневековой немецкой легенды. Согласно ей, музыкант, обманутый магистратом города Гамельна, отказавшимся выплатить вознаграждение за избавление города от крыc, c помощью колдовства увёл за собой городских детей, сгинувших затем безвозвратно.\n\nЛегенда о крысолове, предположительно возникшая в XIII веке, является одной из разновидностей историй о загадочном музыканте, уводящем за собой околдованных людей или скот. Подобные легенды в Средние века имели весьма широкое распространение, при том, что гамельнский вариант является единственным, где c точностью называется дата события — 26 июня 1284 года, и память о котором нашла отражение в хрониках того времени наряду c совершенно подлинными событиями. Всё это вместе взятое заставляет исследователей полагать, будто за легендой о крысолове стояли некие реальные события, уже со временем приобретшие вид народной сказки, однако не существует единой точки зрения, что это были за события или даже когда они произошли. В позднейших источниках, в особенности иностранных, дата по непонятной причине замещается иной — 20 июня 1484 года или же 22 июля 1376 года. Объяснения этому также не найдено. ', '../img/project_avatar/1525496777.8745pp.png', '../uploads/1525496778.1484pp.png', 3, 11, 16, 21, 27, 32, 38, 42, 88, 152, 12978, 1167, '2018-05-05 11:06:17');
INSERT INTO `project` VALUES (50, 'Hooli', 46, 12000, '12', '    “Amazing. Simply amazing.”\n    — Rogelio Padilla, Hooli Executive\n\n    “The design came to me in a dream. It’s intuitive. It’s durable. It tests the boundary between technology and environment. But the signature is all Gavin.”\n    — Dang, Lead Designer\n    “The Box III cements Hooli’s legacy of innovation. And my signature — that’s a promise from me to the Hooli user. To buck the impossible. To keep imagining new ways to change the world. To keep striving for a better tomorrow. To stay restless, never settling for the status quo in data storage devices.”\n— Gavin Belson, Founder and CEO', '../img/project_avatar/1525497108.7522hooli.png', '../uploads/1525497109.1585hooli.png', 3, 9, 13, 20, 27, 31, 38, 43, 88, 152, 12978, 1167, '2018-05-05 11:11:48');
INSERT INTO `project` VALUES (51, 'BitCoin', 46, 120000, '10', 'Используя P2P технологию, Биткойн функционирует без какого-либо контролирующего органа или центрального банка; обработка транзакций и эмиссия осуществляются коллективно участниками сети. Биткойн имеет открытый исходный код; его архитектура известна всему миру, никто не владеет и не контролирует Биткойн, но все могут стать участниками сети. Благодаря своим уникальным свойствам, Биткойн открывает новые горизонты возможностей, которые не предоставляла до этого ни одна платежная система.', '../img/project_avatar/1525497224.3026btc.png', '../uploads/1525497224.5648btc.png', 5, 11, 18, 23, 30, 32, 41, 43, 88, 152, 12978, 1167, '2018-05-05 11:13:44');
INSERT INTO `project` VALUES (52, 'ЖК Арай', 46, 12000, '12', 'Строительство многофункционального жилого комплекса «Арай» выбрано точно в направлении динамично развивающегося центра в Бостандыкском районе города Алматы, в квадрате улиц Сатпаева — Жарокова — Мынбаева — Айманова. Месторасположение жилого комплекса позволяет жителям при необходимости воспользоваться расположенными вблизи городским метро, удобными транспортными развязками. Магнетизм этой территории в том, что в ближайшем будущем она станет средоточием городской активности, здесь будет сформирован новый деловой и культурный центр южной столицы Республики Казахстан.\n\n \n\nЖилой комплекс строится по проекту из современных строительных и отделочных материалов, в том числе с применением инновационных технологий, которые позволяют сделать проект ещё более экологичным, сейсмобезопасным, пожаростойким и комфортным для проживания людей.\n\n \n\nСпециальная конструкция зданий выполнена в металлическом каркасе, выдерживающем 10-балльное землетрясение, изготовление и монтаж металлоконструкций производится флагманом строительной индустрии с 60-летним опытом работы, коллективом АО «Имсталькон».\n\n \n\nНадёжность и повышенная сейсмоустойчивость всех зданий комплекса гарантирует жильцам чувство уверенности и комфорта.\n\n \n\nПомимо использования современных систем отопления, кондиционирования и вентиляции, важным шагом стало внедрение эффективной теплоизоляции ограждающих конструкций здания, которая позволит значительно уменьшить теплопотери и, соответственно, уменьшить необходимое количество теплоносителя для обогрева, что положительно отразится на экологии г. Алматы, и уменьшится парниковый эффект. Всё это отразится в конечном итоге на себестоимости строительства и дальнейшей эксплуатации зданий.\n\n \n\nСданы в эксплуатацию:\n\nМарт-ноябрь 2013 г. — блоки Б-1, Б-2, Б-3, Б-4.\n\nАвгуст 2014 г. — Б-5, Б-6, Б-7.\n\nАвгуст 2015 г. — В-1, В-2, В-3.\n\nАпрель 2016 г. — Г-1, Г-2, Г-3.\n\n \n\nНа территории многофункционального жилого комплекса «Арай» размещены:\n\n— двор (внутренний двор полностью закрыт для автомашин, кроме временной парковки для загрузки-выгрузки строительных материалов, оснащён детскими игровыми площадками для разных возрастов, имеется большая спортивная площадка для занятий футболом, баскетболом и волейболом, а также зелёная аллея для отдыха жильцов во дворе дома);\n\n— двухуровневый подземный паркинг;\n\n— в проекте МЖК «Арай» будут размещаться поликлиники, мини-маркеты, салоны красоты, прачечные, химчистки и многое другое. Внешняя инфраструктура МЖК «Арай»:\n\n— станция «Алатау»;\n\n— дошкольные воспитательные учреждения и детские сады;\n\n— государственные и частные школы;\n\n— высшие учебные заведения;\n\n— торгово-развлекательный центр ADK;\n\n— торгово-развлекательный центр «Глобус»;\n\n— торговый центр «Военторг»;\n\n— парковая зона по пр. Гагарина.\n\n \n\nВ пяти минутах езды от МЖК «Арай» расположены:\n\n— Казахский государственный академический театр драмы им. М. Ауэзова;\n\n— Центральный дворец бракосочетания;\n\n— Казахский государственный цирк;\n\n— парк развлечений Fantasy World Almaty;\n\n— Дворец спорта и культуры им. Б. Шолака;\n\n— Центральный стадион.\n\n \n\nВ многофункциональном жилом комплексе «Арай» на первых этажах предусмотрено размещение офисов, соответствующих всем европейским стандартам и представляющих собой пространство для комфортного ведения бизнеса.\n\n \n\nПри проектировании офисных площадей в комплексе «Арай» особое внимание уделялось балансу между взаимодействием работников и их автономностью. Также учитывалась тенденция к переходу от высокоструктурированных планировок, напоминающих производственные линии и отдельные кабинеты, к помещениям с единым открытым пространством и помещениям для командной работы.\n\n \n\nПользователи офисов класса А высоко ценят наличие микроклимата в любой обстановке, что подчёркивает необходимость большой гибкости систем отопления, вентиляции и кондиционирования воздуха.\n\n \n\nУдобство месторасположения, просторные кабинеты, конференц-залы, специальные коммуникации — всё это говорит в пользу офисных помещений, расположенных в МЖК «Арай».\n\n \n\nРассрочка предоставляется на 6 месяцев.\n\n \n\nИпотека в банках Сбербанк России, Банк Центр Кредит, Алтын банк, Forte банк.\n\n \n\nЦены — от 370 000 тенге до 440 000 тенге за м2.\n\n \n\nОсталось 20 квартир, скидка −5%. Успей купить квартиру у Застройщика без переплат!', NULL, NULL, 1, 7, 18, 23, 30, 36, 37, 43, 88, 81, 8936, 722, '2018-05-05 11:18:56');
